import { createWorkingHourTimeSheet } from "../../redux/actions/CreateNewRequest";


class timesheet extends Component {

    constructor(props) {
        super(props);
        this.state = {

            workinghours: [{
                day: 'Monday',
                workHours: 'Test',
                timeOffHour: 'Test',
                date: 'Test',
                billableHours: 'Test',
