            {
                day: 'Thursday',
                workHours: 'Test',
                timeOffHour: 'Test',
                date: 'Test',
                billableHours: 'Test',
                totalHour: 'Test',
                notes: 'Test'

            },
            {
                day: 'Friday',
                workHours: 'Test',
                timeOffHour: 'Test',
                date: 'Test',
                billableHours: 'Test',
                totalHour: 'Test',
                notes: 'Test'

